import React from 'react';

import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';

const Navbar = props => {
	return (
		<Grid container>
			<Grid item container direction='row-reverse' justify='space-between'>
				<Grid item container xs={5} spacing={3} direction='row-reverse'>
					<Grid item>
						<p>لوگو - تیزتایپ</p>
					</Grid>
					<Grid item>
						<p>چرا تیزتایپ؟</p>
					</Grid>
					<Grid item>
						<p>تعرفه‌ها</p>
					</Grid>
					<Grid item>
						<p>چطور کار میکنه؟</p>
					</Grid>
				</Grid>
				<Grid item container xs={1}>
					<Grid item>
						<p>ثبت‌نام</p>
						<Button color='primary'>ورود</Button>
					</Grid>
				</Grid>
			</Grid>
		</Grid>
	);
};

export default Navbar;
